import React from "react";
import Amadeus from "amadeus";
import SavedTrips from "../components/SavedTrips";
import Landing from "../components/Landing";
import Auth from "../utils/auth";
import "./content.scss";

require("dotenv").config();

const Home = () => {
  const amadeus = new Amadeus({
    clientId: process.env.REACT_APP_AMADEUS_CLIENT_ID,
    clientSecret: process.env.REACT_APP_AMADEUS_CLIENT_SECRET,
  });
  return (
    <>
      {!Auth.loggedIn() && <Landing />}
      {Auth.loggedIn() && (
        <>
          <div className="container text-center mt-5">
            <SavedTrips amadeus={amadeus} />
          </div>

          <div>
            <h1>Parallax Tilt Effect Cards</h1>
            <p>Hover over the cards.</p>
            <section className="main">
              <div className="wrap wrap--1">
                <div className="container container--1">
                  <p>01. Normal</p>
                </div>
              </div>
              <div className="wrap wrap--2">
                <div className="container container--2">
                  <p>02. Reverse</p>
                </div>
              </div>
              <div className="wrap wrap--3">
                <div className="container container--3">
                  <p>03. Normal</p>
                </div>
              </div>
            </section>
            <a
              href="https://abubakersaeed.netlify.app/designs/d10-parallax-tilt-effect-cards"
              className="abs-site-link"
              rel="nofollow noreferrer"
              target="_blank"
            >
              abs/designs/d10-parallax-tilt-effect-cards
            </a>
          </div>
        </>
      )}
    </>
  );
};

export default Home;
